import './ShoppingCard.css'
import { Offcanvas } from "react-bootstrap";
import { useShopingCard } from '../../context/Shopping'
import CardItem from '../CardItem/CardItem'
const ShoppingCard = ()=>{
 const {cardItems} = useShopingCard()

    return <Offcanvas show={true}>

    <Offcanvas.Header closeButton>
     <Offcanvas.Title>Card</Offcanvas.Title>
    </Offcanvas.Header> 

    <Offcanvas.Body>
    {cardItems.map((item)=>{

      return <CardItem 
      
      key={item.id}
      {...item}
      />
   }) }
     

    </Offcanvas.Body>
    
</Offcanvas>


}

 export default ShoppingCard
